import link from "../assets/img/link.png";
import git from "../assets/img/git.png";

const Contact = () => {
  return (
    <div>
      <h1>Me contacter</h1>
      <div className="logos">
        <a href="www.linkedin.com/in/clairehdk" target="_blank">
          <img src={link} alt="linkedin" />
        </a>
      </div>
    </div>
  );
};

export default Contact;
